import React,{Component} from 'react';
import './Separador.css';

class Separador extends Component{
    constructor(props){
        super(props);
        this.state={
            text: props.text
        }
    }

    render(){
        return (
            <div className="separador">
                <svg height="49px">
                    <path d="M200 25 L0 25" stroke="black"></path>
                </svg>
                <h1>{this.state.text}</h1>
                <svg height="49px">
                    <path d="M0 25 L200 25" stroke="black"></path>
                </svg>
            </div>
        );
    }
}

export default Separador;
